        <div className="container">
        {/* headind bar */}
        <div className="heading-bar">
            <h5 className="heading-h5">Add New Enquiry</h5>
        </div>
        {/* heading-bar end */}
        {/* form start */}
        <div className="form-head">

            <form method="post">

                <div className="input-parent">
                <div className="blank-heading">

                </div>
                </div>
            </form>
        </div>
        </div>
        {/* form end */}
        </>
    )
}
